import React from "react";
import Dropdown from "react-bootstrap/Dropdown";

export default function StateDropdown() {
	// const stateList = ["Kansas", "Missouri", "Alabama"];

	<Dropdown id="nav-dropdown-dark-example" title="dropdown" menuVariant="dark">
		<Dropdown.Item href="#action/3.1">Action</Dropdown.Item>
		<Dropdown.Item href="#action/3.2">Another action</Dropdown.Item>
		<Dropdown.Item href="#action/3.3">Something</Dropdown.Item>

		<Dropdown.Divider />
		<Dropdown.Item href="#action/3.4">View All Parks</Dropdown.Item>
	</Dropdown>;
}
